import React from 'react';
import './Header.css';
import Language from './Language';
import {Link} from 'react-router-dom';

const Header = () => {
  return (
    <div className='header'>
        <p>Soccer Tour</p>
        <Link to={'login'}>
          <button type='button'>Sign in</button>
        </Link>

        <Link to={'register'}>
          <button type='button'>Sign up</button>
        </Link>
    </div>
  )
}

export default Header;
